function startClarity(webViewID, webViewRenderNodeId, maskSelectors, unmaskSelectors, maskContentFlag, messageHandlerName) {
  if (document.readyState === "complete" || document.readyState === "loaded" || document.readyState === "interactive") {
      startClarityInternal(webViewID, webViewRenderNodeId, maskSelectors, unmaskSelectors, maskContentFlag, messageHandlerName);
  }
  else {
      document.addEventListener('DOMContentLoaded', (event) => {
          startClarityInternal(webViewID, webViewRenderNodeId, maskSelectors, unmaskSelectors, maskContentFlag, messageHandlerName);
      })
  }
}

function startClarityInternal(webViewID, webViewRenderNodeId, maskSelectors, unmaskSelectors, maskContentFlag, messageHandlerName){
  if(!window["clarity"] || window["clarity"]["v"] === "-1" ) {
      window["clarityhybrid"]("start", webViewID, webViewRenderNodeId, maskSelectors, unmaskSelectors, maskContentFlag, messageHandlerName);
      // Overriding window clarity variable to safe-gate against Clarity for Web starting later
      window["clarity"] = function() {
          if (!window["clarity"].clarityHybridMsgLogged) {
              console.log("No-op because Clarity native SDK is running. Please use the SDK APIs to execute the needed functionality!");
              window["clarity"].clarityHybridMsgLogged = true;
          }
      }
      window["clarity"].v = "-1";
  }
}

function stopClarity() {
  if (window["clarityhybrid"]) {
      window["clarityhybrid"]("stop");
  }
}

function clearClarity() {
  stopClarity()
  delete window["clarityhybrid"]
}
